from collections import Counter

def is_dynamic_string(s: str) -> bool:
    counts = Counter(s)
    if len(counts) <= 3:
        return True
    frequencies = sorted(counts.values(), reverse=True)
    for i in range(2, len(frequencies)):
        if frequencies[i] != frequencies[i - 1] + frequencies[i - 2]:
            (frequencies[0], frequencies[1]) = (frequencies[1], frequencies[0])
            if frequencies[2] == frequencies[1] + frequencies[0]:
                continue
            return False
    return True

